import React from "react";

const JobList = () => {
  // Example job data
  const jobs = [
    {
      id: 1,
      title: "Software Engineer",
      company: "Tech Corp",
      region: "Remote",
      type: "Full Time",
    },
    {
      id: 2,
      title: "Product Manager",
      company: "Innovate Inc",
      region: "New York",
      type: "Full Time",
    },
    {
      id: 3,
      title: "Data Analyst",
      company: "Data Works",
      region: "San Francisco",
      type: "Part Time",
    },
  ];

  return (
    <div>
      <h2>RECENT JOBS</h2>
      <div style={styles.jobList}>
        {jobs.map((job) => (
          <div key={job.id} style={styles.jobItem}>
            <h2>{job.title}</h2>
            <p>{job.company}</p>
            <p>
              {job.region} - {job.type}
            </p>
          </div>
        ))}
      </div>
    </div>
  );
};

const styles = {
  jobList: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  jobItem: {
    border: "1px solid #ddd",
    borderRadius: "5px",
    padding: "20px",
    margin: "10px",
    width: "80%",
    textAlign: "left",
  },
};

export default JobList;
